                                                        "Yes" ? (
                                                          <>
                                                            <div className="  rounded-md gap-2 flex items-center  ">
                                                              <div>
                                                                Verified
                                                              </div>
                                                              <img
                                                                className="h-6 w-10"
                                                                src={Varified}
                                                              />
                                                            </div>
                                                          </>
                                                        ) : null}
                                                      </div>
                                                    </div>
                                                  </div>
                                                </div>
                                              </div>

                                              <div className="flex items-center lg:gap-3 gap-3 mt-4"></div>
                                            </div>
                                          </div>
                                        </div>
                                      </div>
                                      <div className=" lg:w-1/3  bg-green-100 p-2">
                                        <div className="mt-4">
                                          <div className="flex lg:items-center justify-center">
                                            <svg
                                              fill="black"
                                              className="w-4 h-4"
                                              xmlns="http://www.w3.org/2000/svg"
                                              viewBox="0 0 320 512"
                                            >
                                              <path d="M0 64C0 46.3 14.3 32 32 32H96h16H288c17.7 0 32 14.3 32 32s-14.3 32-32 32H231.8c9.6 14.4 16.7 30.6 20.7 48H288c17.7 0 32 14.3 32 32s-14.3 32-32 32H252.4c-13.2 58.3-61.9 103.2-122.2 110.9L274.6 422c14.4 10.3 17.7 30.3 7.4 44.6s-30.3 17.7-44.6 7.4L13.4 314C2.1 306-2.7 291.5 1.5 278.2S18.1 256 32 256h80c32.8 0 61-19.7 73.3-48H32c-17.7 0-32-14.3-32-32s14.3-32 32-32H185.3C173 115.7 144.8 96 112 96H96 32C14.3 96 0 81.7 0 64z" />
                                            </svg>
                                            <div className="font-bold  lg:text-xl text-md ">
                                              {formatBudget(panel.budget)}
                                            </div>
                                          </div>
                                          {panel.security_deposite ? (
                                            <>
                                              <div className="flex items-center justify-center gap-2">
                                                <div className=" font-bold text-center">
                                                  Security Deposit
                                                </div>
                                                <div>
                                                  {panel.security_deposite}
                                                </div>
                                              </div>
                                            </>
                                          ) : null}
                                          <div className="flex justify-center items-center">
                                            <button
                                              onClick={() => {
                                                setModalIsOpen(true);
                                              }}
                                              className="bg-red-600 p-1 mt-2 px-2 text-white rounded-md mb-2"
                                            >
                                              Book Now!
                                            </button>
                                          </div>
                                        </div>
                                      </div>
                                    </div>
                                  </>
                                );
                              })}
                          </>
                        ) : (
                          <p className="text-center mt-24 mb-24 font-bold text-lg text-red-600">
                            No Data Match
                          </p>
                        ))}
                    </div>
                  </div>
                </>
              ) : (
                <>
                  <div className=" min-h-[350px]  grid lg:grid-cols-4 sm:grid-cols-2 grid-cols-1 gap-8 w-full  mt-8 items-start">
                    {newData &&
                      Array.isArray(newData) &&
                      newData.length > 0 &&
                      (newData.filter(filterPanelsByBudget).length > 0 ? (
                        <>
                          {newData
                            .filter(filterPanelsByBudget)
                            .slice(0, showCount)
                            .sort((a, b) => {
                              if (sortBy === "lowToHigh") {
                                return a.budget - b.budget;
                              } else if (sortBy === "highToLow") {
                                return b.budget - a.budget;
                              }
                            })
                            .map((panel) => {
                              return (
                                <>
                                  <div
                                    onClick={() => {
                                      const modifiedPanelName = panel.name
                                        .replace(/\s/g, "-")
                                        .replace(/[^\w\s]/g, "-")
                                        .toLowerCase();

                                      Navigate(
                                        `/rentDetails/-${panel.id}-${modifiedPanelName}`
                                      );
                                      window.scrollTo(0, 0);
                                    }}
                                    className="cursor-pointer"
                                  >
                                    <div
                                      className="border 
                                      rounded-md
                                      cursor-pointer
                                      hover:scale-110
                                      shadow-lg
                                      transition
                                      duration-300
                                      ease-in-out"
                                    >
                                      <div className="rent-image-div">
                                        {panel.image ? (
                                          <>
                                            <div className="felx justify-center gap-6  ">
                                              <img
                                                className="rounded-t-md  cursor-pointer  h-52 w-full "
                                                src={imageshow + panel.image}
                                              />
                                            </div>
                                          </>
                                        ) : (
                                          <>
                                            <img
                                              className="  cursor-pointer w-full  h-52"
                                              src={NoImage}
                                            />
                                          </>
                                        )}
                                        <div className="flex items-center gap-2 justify-center text-green-800 leading-6 font-medium  text-md rent-inner-heading ">
                                          <div> {panel.property_status}</div>
                                        </div>
                                      </div>
                                      <div className="p-1">
                                        <div className="flex mt-4">
                                          <div className="prize-div flex  ">
                                            <svg
                                              fill="#14532d"
                                              className="w-5 h-5 "
                                              xmlns="http://www.w3.org/2000/svg"
                                              viewBox="0 0 320 512"
                                            >
                                              <path d="M0 64C0 46.3 14.3 32 32 32H96h16H288c17.7 0 32 14.3 32 32s-14.3 32-32 32H231.8c9.6 14.4 16.7 30.6 20.7 48H288c17.7 0 32 14.3 32 32s-14.3 32-32 32H252.4c-13.2 58.3-61.9 103.2-122.2 110.9L274.6 422c14.4 10.3 17.7 30.3 7.4 44.6s-30.3 17.7-44.6 7.4L13.4 314C2.1 306-2.7 291.5 1.5 278.2S18.1 256 32 256h80c32.8 0 61-19.7 73.3-48H32c-17.7 0-32-14.3-32-32s14.3-32 32-32H185.3C173 115.7 144.8 96 112 96H96 32C14.3 96 0 81.7 0 64z" />
                                            </svg>
                                            <div>
                                              {formatBudget(panel.budget)}
                                            </div>
                                          </div>
                                          {panel.budget ? (
                                            <>
                                              <div className="px-2"> || </div>
                                            </>
                                          ) : null}
                                          <div className=" text-green-800 leading-6 font-medium  text-md  ">
                                            Sector: {panel.sector}
                                          </div>
                                        </div>
                                        <div className="flex gap-2  items-center content-center">
                                          <div>
                                            <svg
                                              className="h-5 w-5"
                                              xmlns="http://www.w3.org/2000/svg"
                                              viewBox="0 0 384 512"
                                              fill="#14532d"
                                            >
                                              <path d="M215.7 499.2C267 435 384 279.4 384 192C384 86 298 0 192 0S0 86 0 192c0 87.4 117 243 168.3 307.2c12.3 15.3 35.1 15.3 47.4 0zM192 128a64 64 0 1 1 0 128 64 64 0 1 1 0-128z" />
                                            </svg>
                                          </div>
                                          <div class="property-address-div">
                                            {panel.address}
                                          </div>
                                        </div>
                                        <div className="flex gap-2 ml-6 font-bold items-center">
                                          <div>{panel.property_type}</div>
                                        </div>
                                        <div className="flex items-center lg:gap-3 gap-3 mt-4">
                                          <div className="flex items-center gap-2">
                                            {panel.bedrooms ? (
                                              <img className="w-6" src={Bed} />
                                            ) : null}
                                            <div className="font-semibold text-green-800">
                                              {panel.bedrooms}
                                            </div>
                                          </div>
                                          <div className="flex items-center gap-2">
                                            {panel.bathrooms ? (
                                              <img className="w-6" src={Bath} />
                                            ) : null}
                                            <div className="font-semibold text-green-800">
                                              {panel.bathrooms}
                                            </div>
                                          </div>
                                          <div className="flex gap-2 items-center">
                                            <img
                                              className="w-5"
                                              src={panel.varifed}
                                            />
                                          </div>
                                        </div>
                                      </div>
                                    </div>
                                  </div>
                                </>
                              );
                            })}
                        </>
                      ) : (
                        <>
                          <p className="text-center mt-24 mb-24 font-bold text-lg text-red-600">
                            No Data Match
                          </p>
                        </>
                      ))}
                  </div>
                </>
              )}
              <div
                onClick={() => {
                  Navigate("/");
                }}
                className="cursor-pointer lg:block hidden "
              >
                {/* <img className="shadow-lg lg:w-[400px] p-2" src={Ads} /> */}
              </div>
            </div>
          </div>
        </>
      )}
      <OurServices />
      <Searching />
      <ToastContainer />
      <BottomBar />
    </div>
  );
}
